import React from 'react'

export default function profiles({ Leaderboard }) {
  return (
        <div id="profile">
            {Item(Leaderboard)}
        </div>
  )
}

function Item(data){
    return (

        <>
            {
                data.map((value, index) => (
                    <div className="flex" key={index}>
                        <div className="item">
                            <img src={value.img} alt=""/>


                        </div>
                        <div className="item">
                        <h3 className='name text-dark'>{value.score}</h3>    
                            <span>{value.score}</span>
                        </div>
                    </div>
                    )
                )
            }
        </>


    )
}
